from django.db import modelsfrom apps.account.models import Accountfrom apps.logus.models import RoomModel, TariffModelclass RoomTariffModel(models.Model):    room = models.ForeignKey(RoomModel, on_delete=models.CASCADE)    tariff = models.ForeignKey(TariffModel, on_delete=models.CASCADE)    created_by = models.ForeignKey(Account, related_name="room_tariff", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_room_tariff", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.room} - {self.tariff}"